import React from 'react';
// import './contact.css';
import './contact.scss';


import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
} from "@material-ui/core";

export default function Contact({ showModal, handleClose, bgcolor }) {




  return <Dialog
    open={showModal}
    fullWidth
    disableEscapeKeyDown
    aria-labelledby="dialog-title"
    aria-describedby="dialog-description"
    id="dialog-contact"
    maxWidth='xl'
    style={{'--bgcolor':bgcolor}} 
  >
    <div className='dialog-contact-page'>
      <div id="dialog-content-title">
       </div>
      <DialogContent>
        <DialogContentText id="dialog-description">

        </DialogContentText>
      </DialogContent>
      <DialogActions>

          <div class="dialog-close-container" onClick={handleClose}>
  <div class="leftright"></div>
  <div class="rightleft"></div>
  <label class="close">close</label>
</div>

      </DialogActions>
    </div>
  </Dialog>

    ;
}
